import { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { useAuth } from '../context/AuthContext';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import { 
  ClockIcon,
  BeakerIcon,
  FaceSmileIcon,
  HeartIcon
} from '@heroicons/react/24/outline';

// Register ChartJS components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

export default function Dashboard() {
  const { user } = useAuth();
  const [loading, setLoading] = useState(true);
  const [summary, setSummary] = useState(null);
  const [latestLog, setLatestLog] = useState(null);
  const [insights, setInsights] = useState([]);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchData = async () => {
      try {
        setLoading(true);

        // Fetch summary data
        const summaryRes = await axios.get('/api/health-logs/summary');
        setSummary(summaryRes.data.data);
        setLatestLog(summaryRes.data.data.latestLog);

        // Fetch unread insights
        const insightsRes = await axios.get('/api/insights/unread');
        setInsights(insightsRes.data.data);

        setLoading(false);
      } catch (error) {
        console.error('Error fetching dashboard data:', error);
        setError('Failed to load dashboard data');
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  // Chart data setup
  const getChartData = (metricData, label, borderColor) => {
    if (!metricData || metricData.length === 0) return null;

    return {
      labels: metricData.map(item => {
        const date = new Date(item.date);
        return `${date.getMonth() + 1}/${date.getDate()}`;
      }),
      datasets: [
        {
          label,
          data: metricData.map(item => item.value),
          borderColor,
          backgroundColor: 'rgba(0, 0, 0, 0)',
          tension: 0.4,
        },
      ],
    };
  };

  // Chart options
  const chartOptions = {
    responsive: true,
    plugins: {
      legend: {
        display: false,
      },
      tooltip: {
        mode: 'index',
        intersect: false,
      },
    },
    scales: {
      y: {
        beginAtZero: true,
      },
    },
    maintainAspectRatio: false,
  };

  // Format the latest log for display
  const formatLatestLog = () => {
    if (!latestLog) return null;

    const items = [
      {
        icon: ClockIcon,
        title: 'Sleep',
        value: latestLog.sleep?.hours ? `${latestLog.sleep.hours}h` : 'Not logged',
        color: 'bg-blue-100 text-blue-800',
      },
      {
        icon: BeakerIcon,
        title: 'Water',
        value: latestLog.water?.glasses ? `${latestLog.water.glasses} glasses` : 'Not logged',
        color: 'bg-cyan-100 text-cyan-800',
      },
      {
        icon: FaceSmileIcon,
        title: 'Mood',
        value: latestLog.mood || 'Not logged',
        color: 'bg-yellow-100 text-yellow-800',
      },
      {
        icon: HeartIcon,
        title: 'Exercise',
        value: latestLog.exercise?.didExercise ? `${latestLog.exercise.minutes} min` : 'None',
        color: 'bg-red-100 text-red-800',
      },
    ];

    return items;
  };

  if (loading) {
    return (
      <div className="container mx-auto px-4 py-8">
        <div className="flex items-center justify-center min-h-[60vh]">
          <div className="w-12 h-12 border-4 border-primary-500 border-t-transparent rounded-full animate-spin"></div>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="container mx-auto px-4 py-8">
        <div className="bg-red-50 border border-red-400 text-red-700 px-4 py-3 rounded relative" role="alert">
          <strong className="font-bold">Error!</strong>
          <span className="block sm:inline"> {error}</span>
        </div>
      </div>
    );
  }

  return (
    <div className="container mx-auto px-4 py-8">
      <div className="md:flex md:items-center md:justify-between mb-8">
        <div className="flex-1 min-w-0">
          <h1 className="text-2xl font-bold leading-7 text-gray-900 sm:text-3xl sm:truncate">
            👋 Hello, {user?.name || 'Friend'}!
          </h1>
          <p className="mt-1 text-sm text-gray-500">
            {new Date().toLocaleDateString('en-US', { weekday: 'long', year: 'numeric', month: 'long', day: 'numeric' })}
          </p>
        </div>
        <div className="mt-4 flex md:mt-0 md:ml-4">
          <Link
            to="/log"
            className="inline-flex items-center px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-primary-600 hover:bg-primary-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500"
          >
            Log Today's Health
          </Link>
        </div>
      </div>

      {/* Health Score Card */}
      <div className="bg-white overflow-hidden shadow rounded-lg mb-6">
        <div className="px-4 py-5 sm:p-6">
          <div className="flex items-center">
            <div className="flex-shrink-0 bg-primary-100 rounded-md p-3">
              <span className="text-2xl">🌟</span>
            </div>
            <div className="ml-5 w-0 flex-1">
              <dl>
                <dt className="text-sm font-medium text-gray-500 truncate">Health Score</dt>
                <dd>
                  <div className="flex items-baseline">
                    <div className="text-2xl font-semibold text-gray-900">
                      {user?.healthScore || 50}/100
                    </div>
                    <div className="ml-2 flex items-baseline text-sm font-semibold">
                      {user?.healthScore >= 70 ? (
                        <span className="text-green-600">Good</span>
                      ) : user?.healthScore >= 50 ? (
                        <span className="text-yellow-600">Moderate</span>
                      ) : (
                        <span className="text-red-600">Needs Attention</span>
                      )}
                    </div>
                  </div>
                </dd>
              </dl>
            </div>
          </div>
        </div>
      </div>

      {/* Today's Summary */}
      <h2 className="text-lg leading-6 font-medium text-gray-900 mb-4">Today's Summary</h2>

      {latestLog ? (
        <div className="grid grid-cols-1 gap-5 sm:grid-cols-2 lg:grid-cols-4 mb-8">
          {formatLatestLog().map((item, index) => (
            <div key={index} className="bg-white overflow-hidden shadow rounded-lg">
              <div className="px-4 py-5 sm:p-6">
                <div className="flex items-center">
                  <div className={`flex-shrink-0 rounded-md p-3 ${item.color}`}>
                    <item.icon className="h-5 w-5" aria-hidden="true" />
                  </div>
                  <div className="ml-5 w-0 flex-1">
                    <dl>
                      <dt className="text-sm font-medium text-gray-500 truncate">{item.title}</dt>
                      <dd>
                        <div className="text-lg font-medium text-gray-900">{item.value}</div>
                      </dd>
                    </dl>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      ) : (
        <div className="bg-white overflow-hidden shadow rounded-lg mb-8">
          <div className="px-4 py-5 sm:p-6 text-center">
            <p className="text-gray-500">No health data logged yet. Start tracking your health today!</p>
            <Link
              to="/log"
              className="mt-3 inline-flex items-center px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-primary-600 hover:bg-primary-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500"
            >
              Log Health
            </Link>
          </div>
        </div>
      )}

      {/* Recent Trends */}
      <h2 className="text-lg leading-6 font-medium text-gray-900 mb-4">Recent Trends</h2>

      {summary && summary.trends && summary.trends.sleep && summary.trends.sleep.length > 0 ? (
        <div className="grid grid-cols-1 gap-5 lg:grid-cols-2 mb-8">
          {/* Sleep Trend */}
          <div className="bg-white overflow-hidden shadow rounded-lg">
            <div className="px-4 py-5 sm:p-6">
              <h3 className="text-lg leading-6 font-medium text-gray-900 mb-4">Sleep Hours</h3>
              <div className="h-60">
                {summary.trends.sleep.length > 0 && (
                  <Line 
                    data={getChartData(summary.trends.sleep, 'Sleep Hours', '#3b82f6')} 
                    options={chartOptions} 
                  />
                )}
              </div>
            </div>
          </div>

          {/* Mood Trend */}
          <div className="bg-white overflow-hidden shadow rounded-lg">
            <div className="px-4 py-5 sm:p-6">
              <h3 className="text-lg leading-6 font-medium text-gray-900 mb-4">Mood</h3>
              <div className="h-60">
                {summary.trends.mood.length > 0 && (
                  <Line 
                    data={getChartData(summary.trends.mood, 'Mood', '#f59e0b')} 
                    options={chartOptions} 
                  />
                )}
              </div>
            </div>
          </div>
        </div>
      ) : (
        <div className="bg-white overflow-hidden shadow rounded-lg mb-8">
          <div className="px-4 py-5 sm:p-6 text-center">
            <p className="text-gray-500">Not enough data to show trends. Keep logging your health daily!</p>
          </div>
        </div>
      )}

      {/* AI Insights */}
      <h2 className="text-lg leading-6 font-medium text-gray-900 mb-4">AI Insights</h2>

      {insights && insights.length > 0 ? (
        <div className="bg-white overflow-hidden shadow rounded-lg mb-8">
          <div className="px-4 py-5 sm:p-6">
            <ul className="space-y-4">
              {insights.map((insight) => (
                <li key={insight._id} className="bg-gray-50 rounded-md p-4">
                  <div className="flex">
                    <div className="flex-shrink-0">
                      {insight.insightType === 'alert' && (
                        <span className="inline-flex items-center justify-center h-10 w-10 rounded-md bg-red-100 text-red-600 text-xl">
                          ⚠️
                        </span>
                      )}
                      {insight.insightType === 'pattern' && (
                        <span className="inline-flex items-center justify-center h-10 w-10 rounded-md bg-blue-100 text-blue-600 text-xl">
                          🔍
                        </span>
                      )}
                      {insight.insightType === 'suggestion' && (
                        <span className="inline-flex items-center justify-center h-10 w-10 rounded-md bg-green-100 text-green-600 text-xl">
                          💡
                        </span>
                      )}
                      {insight.insightType === 'achievement' && (
                        <span className="inline-flex items-center justify-center h-10 w-10 rounded-md bg-yellow-100 text-yellow-600 text-xl">
                          🏆
                        </span>
                      )}
                    </div>
                    <div className="ml-4">
                      <h4 className="text-lg font-medium text-gray-900">{insight.title}</h4>
                      <p className="mt-1 text-sm text-gray-500">{insight.description}</p>

                      {insight.suggestedActions && insight.suggestedActions.length > 0 && (
                        <div className="mt-3">
                          <h5 className="text-sm font-medium text-gray-700">Suggested Actions:</h5>
                          <ul className="mt-1 text-sm text-gray-500 list-disc list-inside">
                            {insight.suggestedActions.map((action, idx) => (
                              <li key={idx}>{action}</li>
                            ))}
                          </ul>
                        </div>
                      )}
                    </div>
                  </div>
                </li>
              ))}
            </ul>
          </div>
        </div>
      ) : (
        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="px-4 py-5 sm:p-6 text-center">
            <p className="text-gray-500">No insights available yet. Keep logging your health to get personalized insights!</p>
          </div>
        </div>
      )}

      {/* Tip of the Day */}
      <div className="bg-primary-50 overflow-hidden shadow rounded-lg">
        <div className="px-4 py-5 sm:p-6">
          <h2 className="text-lg leading-6 font-medium text-primary-900 mb-2">🧠 Tip of the Day</h2>
          <p className="text-primary-700">
            {[
              "Daily sunlight exposure can improve sleep quality and boost your mood.",
              "Try drinking a glass of water before each meal to stay hydrated.",
              "Even a short 10-minute walk can boost your energy and mental clarity.",
              "Deep breathing for just 2 minutes can help reduce stress and anxiety.",
              "Eating colorful fruits and vegetables helps ensure you get a variety of nutrients."
            ][Math.floor(Math.random() * 5)]}
          </p>
        </div>
      </div>
    </div>
  );
}
